import React from "react";
import {StyleSheet,Text,View} from "react-native";

export default function Header()
{
    return (
        <View style={styles.header}>
        </View>
    );
}
const styles=StyleSheet.create({
    header:{
        width:'100%',
        height:100,
        backgroundColor:"black",
    }
})
